export function CoursesPage() {
    const [data, setData] = useState([])
    useEffect(() => {
        fetch("https://api.jsonbin.io/v3/b/62ea6c6e70a3846ee752bb43")
            .then((X) => { return X.record().json })
            .then((response) => { 
                setData(response) 
            console.log(response)})
    })
    return (
        <>
            {data.sort((a, b) => a - b).map((index) => {
                return (
                    <div className="card">
                        <img src={index.imageUrl} className="card-img-top" alt="..." />
                        <div className="card-body">
                            <h5 className="card-title">{index.name}</h5>
                            <p className="card-text">{index.messege}</p>
                            {/* <a href="#" className="btn btn-primary">Go somewhere</a> */}
                        </div>
                    </div>
                )
            })}
        </>
    )
}
